  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Camas Migratory
  Waterfowl Refuge outlines Refuge accomplishments from October through December of
  1938. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, and rodents- is also covered. The Refuge development
  and maintenance section discusses physical developments and collections and receipts.
  Resource management is outlined; topics include grazing, haying, and sharecropping.
  The public relations section of the report describes violations.\",\n\t\"license_title\":
